import React, { useContext } from 'react';
import { StyleSheet, Text, View } from 'react-native';

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
const Stack = createStackNavigator();
import CreateTrack from "./src/screens/CreateTrack";
import LoginScreen from "./src/screens/LoginScreen";
import RegisterScreen from "./src/screens/RegisterScreen";
import TrackDetail from "./src/screens/TrackDetail";
import TrackLIst from "./src/screens/TrackLIst";
import AccountScreen from "./src/screens/AccountScreen";
import { Provider as AuthProvider } from "./src/context/AuthContext"
import { Context as AuthContext } from "./src/context/AuthContext"

const { Navigator, Screen } = Stack;
// import AsyncStorage from "@react-native-community/async-storage"

export default function App() {
  const Logging = [
    { name: "RegisterScreen", component: RegisterScreen, options: { title: "Register" } },
    { name: "LoginScreen", component: LoginScreen, options: { title: "Login", headerLeft: null } },
    { name: "CreateTrack", component: CreateTrack, options: {} },
    { name: "TrackDetail", component: TrackDetail, options: {} },
    { name: "TrackList", component: TrackLIst, options: {} },
    { name: "AccountScreen", component: AccountScreen, options: {} }
  ]

  const state = useContext(AuthContext);
  console.log('state from app: ', state);

  // var getToken = async ()=> await AsyncStorage.getItem("token").then((value) => value);
  // var token = getToken()

  // console.log('token: ', token);
  return (
    <AuthProvider>
      <NavigationContainer>
        <App/>
      </NavigationContainer>
    </AuthProvider>
  );

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
